import{_ as e,c as t,o,ae as i}from"./chunks/framework.DNNxon85.js";const c="/rbq10_docs/assets/map-loc-fail.BDJZoiE2.png",d="/rbq10_docs/assets/auto-bat-low.Ct6Tvuwl.png",s="/rbq10_docs/assets/auto-lidar-fail.BV2_sZlE.png",l="/rbq10_docs/assets/auto-scheduler-off.BAz4ey0q.png",n="/rbq10_docs/assets/auto-toggle.DiqntyEr.png",r="/rbq10_docs/assets/auto-view-2d.BB2CR6mm.png",b="/rbq10_docs/assets/auto-view-3d.B19EsMpK.png",p="/rbq10_docs/assets/auto-view-follow.BXS56lMU.png",h="/rbq10_docs/assets/map-folder.cFLvHCxr.png",v="/rbq10_docs/assets/map-map-load-btn.C8WWN2ow.png",g="/rbq10_docs/assets/map-loaded-map.CGppN9U9.png",u="/rbq10_docs/assets/map-connect-loc.exqYQVyn.png",m="/rbq10_docs/assets/map-loc-fail.BDJZoiE2.png",f="/rbq10_docs/assets/map-tog-on.C-iSJMB2.png",k="/rbq10_docs/assets/map-annotation.BJMr-aF7.png",S="/rbq10_docs/assets/map-stand.CrIZHMMe.png",q="/rbq10_docs/assets/map-walk.CFS7mruI.png",_="/rbq10_docs/assets/map-overlap.DPVcETrx.png",y="/rbq10_docs/assets/map-quick-anno.R5pwlClx.png",x="/rbq10_docs/assets/map-node-connect.NSLtBOmR.png",w="/rbq10_docs/assets/map-drive.B8e4z_d8.png",T="/rbq10_docs/assets/map-rtb.BzB3M6X5.png",C="/rbq10_docs/assets/task-tab.DRpbWblm.png",P="/rbq10_docs/assets/task-add.5gwZaLhQ.png",L="/rbq10_docs/assets/task-node-list.DZDFdxp3.png",A="/rbq10_docs/assets/task-save.DyBDsDq-.png",N="/rbq10_docs/assets/task-json.0nPwYKSz.png",E="/rbq10_docs/assets/task-start.Bu5YCm_K.png",M="/rbq10_docs/assets/schedule-tab.BL087eGd.png",I="/rbq10_docs/assets/schedule-time.DT6waHKd.png",R="/rbq10_docs/assets/schedule-task-files._juDiPhz.png",D="/rbq10_docs/assets/schedule-save.Cgyc-BCd.png",H=JSON.parse('{"title":"SLAM Navigation Quick Start","description":"","frontmatter":{"layout":"doc","outline":"deep"},"headers":[],"relativePath":"manual/start-slam-quick-start.md","filePath":"manual/start-slam-quick-start.md"}'),O={name:"manual/start-slam-quick-start.md"};function B(F,a,z,U,V,Q){return o(),t("div",null,a[0]||(a[0]=[i('<h1 id="slam-navigation-quick-start" tabindex="-1" data-v-eb7543ca>SLAM Navigation Quick Start <a class="header-anchor" href="#slam-navigation-quick-start" aria-label="Permalink to &quot;SLAM Navigation Quick Start&quot;" data-v-eb7543ca>‚Äã</a></h1><h2 id="auto-quick-start-if-there-are-scheduled-tasks" tabindex="-1" data-v-eb7543ca>Auto Quick Start (if there are scheduled tasks) <a class="header-anchor" href="#auto-quick-start-if-there-are-scheduled-tasks" aria-label="Permalink to &quot;Auto Quick Start (if there are scheduled tasks)&quot;" data-v-eb7543ca>‚Äã</a></h2><blockquote data-v-eb7543ca><p data-v-eb7543ca>üí° The scheduled tasks will start automatically when the robot is powered on.</p></blockquote><h3 id="step-1-check-fail-messages" tabindex="-1" data-v-eb7543ca>Step 1: Check fail messages <a class="header-anchor" href="#step-1-check-fail-messages" aria-label="Permalink to &quot;Step 1: Check fail messages&quot;" data-v-eb7543ca>‚Äã</a></h3><ul data-v-eb7543ca><li data-v-eb7543ca>LiDAR, Camera, Localization, Robot fail messages on left top side</li></ul><blockquote data-v-eb7543ca><p data-v-eb7543ca>‚ö†Ô∏è If any fail message is shown, follow the instructions:</p><ol data-v-eb7543ca><li data-v-eb7543ca>If Localization fail, try auto init again.</li><li data-v-eb7543ca>If LiDAR, Camera, Robot fail, try Cold Start.</li></ol></blockquote><figure data-v-eb7543ca><img src="'+c+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ Localization Failed ]</figcaption></figure><div class="image-group" data-v-eb7543ca><figure data-v-eb7543ca><img src="'+d+'" alt="missing" data-v-eb7543ca><figcaption data-v-eb7543ca>[ RBQ10 Low Battery ]</figcaption></figure><figure data-v-eb7543ca><img src="'+s+'" alt="missing" data-v-eb7543ca><figcaption data-v-eb7543ca>[ LiDAR Connection Failed ]</figcaption></figure></div><br data-v-eb7543ca><h3 id="step-2-check-schedule-status" tabindex="-1" data-v-eb7543ca>Step 2: Check schedule status <a class="header-anchor" href="#step-2-check-schedule-status" aria-label="Permalink to &quot;Step 2: Check schedule status&quot;" data-v-eb7543ca>‚Äã</a></h3><blockquote data-v-eb7543ca><li data-v-eb7543ca>SCHEDULER ON: there are saved scheduled tasks.</li><li data-v-eb7543ca>SCHEDULER OFF: there are NO saved scheduled tasks.</li><p data-v-eb7543ca>üí°¬†¬†If there are scheduled tasks but the scheduler status is ‚ÄúOFF‚Äù, the scheduled tasks will not start.</p></blockquote><figure data-v-eb7543ca><img src="'+l+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ SCHEUDULER OFF ]</figcaption></figure><br data-v-eb7543ca><h3 id="step-3-activate-enable-slam-enabled-toggle-button" tabindex="-1" data-v-eb7543ca>Step 3: Activate <code data-v-eb7543ca>Enable SLAM Enabled</code> toggle button. <a class="header-anchor" href="#step-3-activate-enable-slam-enabled-toggle-button" aria-label="Permalink to &quot;Step 3: Activate `Enable SLAM Enabled` toggle button.&quot;" data-v-eb7543ca>‚Äã</a></h3><blockquote data-v-eb7543ca><p data-v-eb7543ca>üí° If OFF, autonomous driving will not work.</p></blockquote><figure data-v-eb7543ca><img src="'+n+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ SLAM Enabled ON ]</figcaption></figure><br data-v-eb7543ca><h3 id="step-4-change-the-map-view-perspective" tabindex="-1" data-v-eb7543ca>Step 4: Change the map view perspective. <a class="header-anchor" href="#step-4-change-the-map-view-perspective" aria-label="Permalink to &quot;Step 4: Change the map view perspective.&quot;" data-v-eb7543ca>‚Äã</a></h3><ul data-v-eb7543ca><li data-v-eb7543ca>2D, 3D, Follow View Change buttons</li></ul><figure data-v-eb7543ca><img src="'+r+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ 2D View ]</figcaption></figure><figure data-v-eb7543ca><img src="'+b+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ 3D View ]</figcaption></figure><figure data-v-eb7543ca><img src="'+p+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ Follow View ]</figcaption></figure><br data-v-eb7543ca><h3 id="optional-step-5-restart" tabindex="-1" data-v-eb7543ca>(Optional) Step 5: Restart <a class="header-anchor" href="#optional-step-5-restart" aria-label="Permalink to &quot;(Optional) Step 5: Restart&quot;" data-v-eb7543ca>‚Äã</a></h3><ol data-v-eb7543ca><li data-v-eb7543ca><p data-v-eb7543ca>Once the task and schedule settings are completed, take the robot to the docking station and initiate docking (or make it sit in front).</p></li><li data-v-eb7543ca><p data-v-eb7543ca>Perform <code data-v-eb7543ca>Cold Start</code>. The schedule tasks will automatically start.</p></li><li data-v-eb7543ca><p data-v-eb7543ca>After <code data-v-eb7543ca>Cold Start</code>, initialize the robot by pressing <code data-v-eb7543ca>Connect</code> ‚Üí <code data-v-eb7543ca>Auto Robot Start</code> buttons on STEAM DECK.</p></li><li data-v-eb7543ca><p data-v-eb7543ca>Turn ON <code data-v-eb7543ca>Enable EXT Joystick</code>.</p></li></ol><h2 id="template-map-load-saved-map-and-set-the-path" tabindex="-1" data-v-eb7543ca>Template Map: Load Saved Map and Set the Path <a class="header-anchor" href="#template-map-load-saved-map-and-set-the-path" aria-label="Permalink to &quot;Template Map: Load Saved Map and Set the Path&quot;" data-v-eb7543ca>‚Äã</a></h2><blockquote data-v-eb7543ca><p data-v-eb7543ca>üí° Make sure the robot to be placed near the base node when starting for the first time.</p></blockquote><h3 id="step-1-unzip-map-zip-folder" tabindex="-1" data-v-eb7543ca>Step 1: Unzip Map Zip Folder <a class="header-anchor" href="#step-1-unzip-map-zip-folder" aria-label="Permalink to &quot;Step 1: Unzip Map Zip Folder&quot;" data-v-eb7543ca>‚Äã</a></h3><p data-v-eb7543ca>Extract <code data-v-eb7543ca>sra_template.zip</code> zip folder to <code data-v-eb7543ca>sra_template</code> in <code data-v-eb7543ca>Home/maps_3d</code> directory.</p><figure data-v-eb7543ca><img src="'+h+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ Follow View ]</figcaption></figure><br data-v-eb7543ca><h3 id="step-2-load-the-map" tabindex="-1" data-v-eb7543ca>Step 2: Load the Map <a class="header-anchor" href="#step-2-load-the-map" aria-label="Permalink to &quot;Step 2: Load the Map&quot;" data-v-eb7543ca>‚Äã</a></h3><ol data-v-eb7543ca><li data-v-eb7543ca>Click <code data-v-eb7543ca>Map load</code> button.</li><li data-v-eb7543ca>Select the extracted folder <code data-v-eb7543ca>sra_template</code> in Step 1.</li><li data-v-eb7543ca>If the map is properly loaded, <code data-v-eb7543ca>Map load</code> button will turn to green.</li><li data-v-eb7543ca>If the robot is turned on, the most recently loaded map will be automatically loaded.</li></ol><blockquote data-v-eb7543ca><p data-v-eb7543ca>üí° If map is huge, it might take long time.</p></blockquote><div class="image-group" data-v-eb7543ca><figure data-v-eb7543ca><img src="'+v+'" alt="missing" data-v-eb7543ca><figcaption data-v-eb7543ca>[ Map load button ]</figcaption></figure><figure data-v-eb7543ca><img src="'+g+'" alt="missing" data-v-eb7543ca><figcaption data-v-eb7543ca>[ Loaded Map ]</figcaption></figure></div><br data-v-eb7543ca><h3 id="step-3-check-localization" tabindex="-1" data-v-eb7543ca>Step 3: Check Localization <a class="header-anchor" href="#step-3-check-localization" aria-label="Permalink to &quot;Step 3: Check Localization&quot;" data-v-eb7543ca>‚Äã</a></h3><figure style="margin-left:150px;margin-right:150px;" data-v-eb7543ca><img src="'+u+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ Connect button, LOC START button ]</figcaption></figure><p data-v-eb7543ca>Confirm that ‚ÄúConnect‚Äù button and ‚ÄúLOC START‚Äù button are green.</p><blockquote data-v-eb7543ca><p data-v-eb7543ca>‚ö†Ô∏è If either one of the buttons is not green, re-dock the robot or sit the robot in front of the docking station and reboot.</p></blockquote><p data-v-eb7543ca>If localization works properly, the robot within the map will automatically adjust its position.</p><blockquote data-v-eb7543ca><p data-v-eb7543ca>‚ö†Ô∏è If the robot doesn‚Äôt adjust its position correctly(localization failed), try auto init.</p><figure data-v-eb7543ca><img src="'+m+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ Localization Failed ]</figcaption></figure></blockquote><h3 id="step-4-activate-enable-ext-joystick-toggle-button" tabindex="-1" data-v-eb7543ca>Step 4: Activate ‚ÄúEnable EXT Joystick‚Äù toggle button <a class="header-anchor" href="#step-4-activate-enable-ext-joystick-toggle-button" aria-label="Permalink to &quot;Step 4: Activate ‚ÄúEnable EXT Joystick‚Äù toggle button&quot;" data-v-eb7543ca>‚Äã</a></h3><p data-v-eb7543ca>It will disable the manual control via STEAM DECK joystick and enables the autonomous driving.</p><figure style="margin-left:150px;margin-right:150px;" data-v-eb7543ca><img src="'+f+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ Enable EXT Joystick ON ]</figcaption></figure><h3 id="step-5-switch-to-annotation-mode" tabindex="-1" data-v-eb7543ca>Step 5: Switch to &quot;ANNOTATION&quot; mode <a class="header-anchor" href="#step-5-switch-to-annotation-mode" aria-label="Permalink to &quot;Step 5: Switch to &quot;ANNOTATION&quot; mode&quot;" data-v-eb7543ca>‚Äã</a></h3><figure style="margin-left:150px;margin-right:150px;" data-v-eb7543ca><img src="'+k+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ ANNOTATION mode ]</figcaption></figure><h3 id="step-6-make-robot-stand-up-walk-and-move-forward-by-2-meters" tabindex="-1" data-v-eb7543ca>Step 6: Make Robot Stand Up, Walk, and Move forward by 2 meters <a class="header-anchor" href="#step-6-make-robot-stand-up-walk-and-move-forward-by-2-meters" aria-label="Permalink to &quot;Step 6: Make Robot Stand Up, Walk, and Move forward by 2 meters&quot;" data-v-eb7543ca>‚Äã</a></h3><p data-v-eb7543ca>In <code data-v-eb7543ca>Pose</code> tab at bottom left,</p><div class="image-group" data-v-eb7543ca><figure data-v-eb7543ca><img src="'+S+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ Stand button ]</figcaption></figure><figure data-v-eb7543ca><img src="'+q+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ Walk button ]</figcaption></figure></div><ol data-v-eb7543ca><li data-v-eb7543ca>Click <code data-v-eb7543ca>Stand</code> button.</li><li data-v-eb7543ca>Click <code data-v-eb7543ca>Walk</code> button.</li></ol><p data-v-eb7543ca>Then, in <code data-v-eb7543ca>Move</code> tab,</p><ol start="3" data-v-eb7543ca><li data-v-eb7543ca>Move the robot forward by 2 meters.</li><li data-v-eb7543ca>Confirm that the robot(blue) doesn&#39;t overlap with the base node(yellow).</li></ol><figure data-v-eb7543ca><img src="'+_+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ ]</figcaption></figure><h3 id="step-7-set-the-path" tabindex="-1" data-v-eb7543ca>Step 7: Set the Path <a class="header-anchor" href="#step-7-set-the-path" aria-label="Permalink to &quot;Step 7: Set the Path&quot;" data-v-eb7543ca>‚Äã</a></h3><figure data-v-eb7543ca><img src="'+y+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ Quick annotation button ]</figcaption></figure><ol data-v-eb7543ca><li data-v-eb7543ca>Click <code data-v-eb7543ca>Quick annotation</code> button. -&gt; automatically set the first goal node, and record the path</li><li data-v-eb7543ca>Move the robot -&gt; automatically create the path and nodes</li><li data-v-eb7543ca>Click <code data-v-eb7543ca>Quick annotation</code> button again. -&gt; finish the path setting</li></ol><h3 id="step-8-connect-the-base-node-and-the-first-goal-node" tabindex="-1" data-v-eb7543ca>Step 8: Connect the base node and the first goal node <a class="header-anchor" href="#step-8-connect-the-base-node-and-the-first-goal-node" aria-label="Permalink to &quot;Step 8: Connect the base node and the first goal node&quot;" data-v-eb7543ca>‚Äã</a></h3><blockquote data-v-eb7543ca><p data-v-eb7543ca>The base node and the first goal node which was set automatically at Step 9 must be connected.</p></blockquote><p data-v-eb7543ca>To link the two nodes,</p><ol data-v-eb7543ca><li data-v-eb7543ca>Hold <code data-v-eb7543ca>Shift</code> key in the keyboard and select the base node(yellow) and the first goal node(blue).</li><li data-v-eb7543ca>Press <code data-v-eb7543ca>B</code> key in the keyboard or <code data-v-eb7543ca>Add link2[B]</code> button in the top bar.</li><li data-v-eb7543ca>A link will be created and connected the two nodes.</li></ol><figure data-v-eb7543ca><img src="'+x+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ Connected base node and first goal node ]</figcaption></figure><h3 id="step-9-if-node-editing-finished-switch-to-drive-mode" tabindex="-1" data-v-eb7543ca>Step 9: If node editing finished, switch to <code data-v-eb7543ca>DRIVE</code> mode <a class="header-anchor" href="#step-9-if-node-editing-finished-switch-to-drive-mode" aria-label="Permalink to &quot;Step 9: If node editing finished, switch to `DRIVE` mode&quot;" data-v-eb7543ca>‚Äã</a></h3><figure style="margin-left:150px;margin-right:150px;" data-v-eb7543ca><img src="'+w+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ DRIVE mode ]</figcaption></figure><h3 id="step-10-return-to-base-node" tabindex="-1" data-v-eb7543ca>Step 10: Return to Base Node <a class="header-anchor" href="#step-10-return-to-base-node" aria-label="Permalink to &quot;Step 10: Return to Base Node&quot;" data-v-eb7543ca>‚Äã</a></h3><p data-v-eb7543ca>Click <code data-v-eb7543ca>RTB</code> button in <code data-v-eb7543ca>Task</code> tab at right bottom section. It will check whether the robot can drive autonomously to its destination(base node) by the path created.</p><figure style="margin-left:150px;margin-right:150px;" data-v-eb7543ca><img src="'+T+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ RTB button ]</figcaption></figure><blockquote data-v-eb7543ca><p data-v-eb7543ca>‚ö†Ô∏è If the robot doesn‚Äôt head towards the docking station, check if all the nodes, especially between the first goal node and the base node in Step 9, are connected properly.</p></blockquote><h2 id="task-tab-save-the-task-path" tabindex="-1" data-v-eb7543ca>Task Tab: Save the Task Path <a class="header-anchor" href="#task-tab-save-the-task-path" aria-label="Permalink to &quot;Task Tab: Save the Task Path&quot;" data-v-eb7543ca>‚Äã</a></h2><h3 id="task-tab" tabindex="-1" data-v-eb7543ca>Task Tab <a class="header-anchor" href="#task-tab" aria-label="Permalink to &quot;Task Tab&quot;" data-v-eb7543ca>‚Äã</a></h3><figure style="margin-left:150px;margin-right:150px;" data-v-eb7543ca><img src="'+C+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ Task tab ]</figcaption></figure><ul data-v-eb7543ca><li data-v-eb7543ca><code data-v-eb7543ca>Task Add[U]</code>, <code data-v-eb7543ca>Task Delete[I]</code>, <code data-v-eb7543ca>Save</code>, <code data-v-eb7543ca>Load</code>, <code data-v-eb7543ca>Reload</code> buttons: <br data-v-eb7543ca>set one or multiple goals in <code data-v-eb7543ca>Task Node List</code></li><li data-v-eb7543ca>Only goal nodes can be added in <code data-v-eb7543ca>Task Node List</code>, which will be done in the corresponding order.</li><li data-v-eb7543ca>Robot will sequentially reach each goal node and lastly return to the base node.</li></ul><h3 id="step-1-add-tasks-goal-nodes" tabindex="-1" data-v-eb7543ca>Step 1: Add Tasks (Goal Nodes) <a class="header-anchor" href="#step-1-add-tasks-goal-nodes" aria-label="Permalink to &quot;Step 1: Add Tasks (Goal Nodes)&quot;" data-v-eb7543ca>‚Äã</a></h3><figure data-v-eb7543ca><img src="'+P+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ Add Goal Node to Task Node List ]</figcaption></figure><ol data-v-eb7543ca><li data-v-eb7543ca>Press <code data-v-eb7543ca>Shift</code> key in the keyboard and click the goal node(blue).</li><li data-v-eb7543ca>Click <code data-v-eb7543ca>Task Add[U]</code> button, then the corresponding goal node will be added to <code data-v-eb7543ca>Task Node List</code>.</li></ol><h3 id="step-2-save-the-tasks" tabindex="-1" data-v-eb7543ca>Step 2: Save the Tasks <a class="header-anchor" href="#step-2-save-the-tasks" aria-label="Permalink to &quot;Step 2: Save the Tasks&quot;" data-v-eb7543ca>‚Äã</a></h3><p data-v-eb7543ca>After adding all the goal nodes in the desired order, click <code data-v-eb7543ca>Save</code> button. <br data-v-eb7543ca> Multiple goal nodes can be set, then the robot will sequentially reach each goal node and return to the base node after all finish.</p><div class="image-group" data-v-eb7543ca><figure data-v-eb7543ca><img src="'+L+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ Goal Nodes in Order ]</figcaption></figure><figure data-v-eb7543ca><img src="'+A+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ Save button ]</figcaption></figure></div><h3 id="step-3-save-the-task-file" tabindex="-1" data-v-eb7543ca>Step 3: Save the Task File <a class="header-anchor" href="#step-3-save-the-task-file" aria-label="Permalink to &quot;Step 3: Save the Task File&quot;" data-v-eb7543ca>‚Äã</a></h3><p data-v-eb7543ca>Rename the task file name like <code data-v-eb7543ca>task_(desired name).json</code>.</p><blockquote data-v-eb7543ca><p data-v-eb7543ca>‚ö†Ô∏è If the name NOT follows the template as <code data-v-eb7543ca>task_*.json</code>, the file will be not loaded afterwards.</p></blockquote><figure data-v-eb7543ca><img src="'+N+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ Proper task file names (red box) ]</figcaption></figure><h3 id="step-4-start-the-task" tabindex="-1" data-v-eb7543ca>Step 4: Start the Task <a class="header-anchor" href="#step-4-start-the-task" aria-label="Permalink to &quot;Step 4: Start the Task&quot;" data-v-eb7543ca>‚Äã</a></h3><p data-v-eb7543ca>To move the robot by the tasks saved in <code data-v-eb7543ca>Task Node List</code>, click <code data-v-eb7543ca>Start[0]</code> button.</p><figure style="margin-left:150px;margin-right:150px;" data-v-eb7543ca><img src="'+E+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ Start button ]</figcaption></figure><blockquote data-v-eb7543ca><ol data-v-eb7543ca><li data-v-eb7543ca>The robot MUST always start near the docking station within 2 meters.</li><li data-v-eb7543ca>If there are no goal nodes <code data-v-eb7543ca>Task Node List</code>, it will not move.</li></ol></blockquote><h2 id="schedule-tab-set-the-schedule-of-saved-task" tabindex="-1" data-v-eb7543ca>Schedule Tab: Set the Schedule of Saved Task <a class="header-anchor" href="#schedule-tab-set-the-schedule-of-saved-task" aria-label="Permalink to &quot;Schedule Tab: Set the Schedule of Saved Task&quot;" data-v-eb7543ca>‚Äã</a></h2><h3 id="schedule-tab" tabindex="-1" data-v-eb7543ca>Schedule Tab <a class="header-anchor" href="#schedule-tab" aria-label="Permalink to &quot;Schedule Tab&quot;" data-v-eb7543ca>‚Äã</a></h3><figure style="margin-left:100px;margin-right:200px;" data-v-eb7543ca><img src="'+M+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ Schedule Tab ]</figcaption></figure><ul data-v-eb7543ca><li data-v-eb7543ca>Schedule option allows the robot to perform tasks at specific given times.</li><li data-v-eb7543ca>Set the schedule while the robot is NOT in autonomous driving and in SCHEDULER OFF status.</li></ul><h3 id="step-1-set-the-schedule-and-task" tabindex="-1" data-v-eb7543ca>Step 1: Set the Schedule and Task <a class="header-anchor" href="#step-1-set-the-schedule-and-task" aria-label="Permalink to &quot;Step 1: Set the Schedule and Task&quot;" data-v-eb7543ca>‚Äã</a></h3><div class="image-group" data-v-eb7543ca><figure data-v-eb7543ca><img src="'+I+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ Add Time ]</figcaption></figure><figure data-v-eb7543ca><img src="'+R+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ Task Files ]</figcaption></figure></div><ol data-v-eb7543ca><li data-v-eb7543ca>Set the time.</li><li data-v-eb7543ca>Click <code data-v-eb7543ca>Add</code> button.</li><li data-v-eb7543ca>Click <code data-v-eb7543ca>Load</code> button.</li><li data-v-eb7543ca>Select the task file named <code data-v-eb7543ca>task_*.json</code>.</li></ol><h3 id="step-2-save-schedule-list" tabindex="-1" data-v-eb7543ca>Step 2: Save Schedule List <a class="header-anchor" href="#step-2-save-schedule-list" aria-label="Permalink to &quot;Step 2: Save Schedule List&quot;" data-v-eb7543ca>‚Äã</a></h3><figure style="margin-left:150px;margin-right:150px;" data-v-eb7543ca><img src="'+D+'" alt="missing" data-v-eb7543ca><figcaption style="text-align:center;" data-v-eb7543ca>[ Task Files ]</figcaption></figure><ol data-v-eb7543ca><li data-v-eb7543ca>If the loaded task file with the setting time has been added to <code data-v-eb7543ca>Schedule List</code> correctly, click <code data-v-eb7543ca>Save</code> button.</li><li data-v-eb7543ca>To start scheduled task, press <code data-v-eb7543ca>ON</code> button.</li></ol><blockquote data-v-eb7543ca><p data-v-eb7543ca>üí° When the robot restarts,</p><ol data-v-eb7543ca><li data-v-eb7543ca>If ON, the saved scheduled tasks will be automatically loaded.</li><li data-v-eb7543ca>If OFF, the saved scheduled tasks will NOT be loaded.</li></ol></blockquote>',97)]))}const J=e(O,[["render",B],["__scopeId","data-v-eb7543ca"]]);export{H as __pageData,J as default};
